Head distinctly wider ( 0.260–0.265 mm ) than long (0.200– 0.225 mm ), frontal rostrum 0.125–0.135 mm wide and 0.060 mm long. Eyes with 16–22 ommatidia. Last segment of maxillary palpi 0.160–0.165 mm long and 0.060 mm wide, with slightly convex lateral margin. Antennae (
Fig. 1
