Male. Posterior margin of mesotrochanters extended into short median spine, all femora and tibiae unarmed, all abdominal sternites apparently not modified. Aedeagus (
Figs. 5–8
) 0.310–0.335 mm long, with sinuate and canaliculate dorsal apophysis of median lobe enlarged at apex, bearing some short bristles at middle of mesal margin. Ventral portion of median lobe very large at base, directed laterally and constricted at apex. Ventral portion of median lobe bearing two long spine-like apophyses on mesal margin. Shape of apex of dorsal apophysis of median lobe shows moderate variability, also slightly variable are two long apophyses of ventral portion of median lobe (
Figs. 5–8
).
